"use strict";

const create = require("./wasm-hash");

//#region wasm code: xxhash64 (../../../assembly/hash/xxhash64.asm.ts) --initialMemory 1
const xxhash64 = new WebAssembly.Module(
	Buffer.from(
		// 1170 bytes
		"",
		"base64"
	)
);
//#endregion

module.exports = create.bind(null, xxhash64, [], 32, 16);
